                                            "fkqzki322dw693tluznw": "本方案采用两种真实的日志（HTTP Logs 日志和 GitHub Events 用户行为日志）作为数据源，下载和安装两种日志采集器（Logstash 和 Filebeat）用于对日志的采集，通过 SelectDB 开放接口把日志存储到 SelectDB 中。SelectDB 通过SIMD 等 CPU 向量化指令提升写入性能，通过列式存储和 ZSTD 压缩降低存储成本，在实现高性能的同时保持很低的成本。其次，SelectDB 的 Light Schema Change 和半结构化数据类型 VARIANT 支持 FlexibleSchema，能够灵活应对日志数据的多样性和复杂性，可以写入任何 JSON 动态数据并自动识别其中字段名和类型，采用列式存储以便于后续高效分析。此外，SelectDB 提供了类似 Kibana Discover 的日志检索分析界面，支持基于时间段、关键字检索以及 SQL 查询的日志分析。",
